    false,nt"url": null,nt"notes": "Knowledge of the reproductive biology of
    fish and crab stocks is critical to stock assessment estimates of the reproductive
    potential (typically measured as spawning stock biomass) of the stock, a factor
    often used to calculate biological reference points used for fisheries management.
     While quantitative assessment of reproductive biology parameters is essential
    for stock assessment calculations, qualitative information on spawning dynamics
    and spawning strategy also provides important information, especially as fisheries
    management has begun taking an ecosystem approach to management.  The spawning strategy
    of each species is informative as to their link in the ecosystem and their potential
    vulnerability to fishing or other disturbance.   In addition, understanding the
    spatial and temporal dynamics of fish spawning is important for understanding trophic
    ecosystem interactions in ecosystems and dynamics of the commercial fishery since
    spawning aggregations are often targeted by top level predators and fisherman alike.
    nThis database represents reproductive data of North Pacific fishes collected by
    AFSC scientists and North Pacific groundfish observers during either NMFS research
    cruises or aboard commercial fishing vessels.    All classifications were either
    based on histological analysis or gross morphological observations of ovaries and
    gonads collected in the field.",nt"license_title": null,nt"extras": [{ntt"key":
